import "../css/detailLoc.css";

const DetailLoc = ({ position }) => {

    return(
        <React.Fragment>
            <div className="detail_comp">
                <p>{position.name}</p>
                <p>{position.memo}</p>
            </div>
            <button className="close_bt">{'<'}</button>
        </React.Fragment>
    )
}

export default DetailLoc;
